import React, { useEffect, useState } from 'react';
import { BrowserRouter, Routes, Route, Link} from 'react-router-dom'
import ShowMenu from './ShowMenu';
import ShowMenuItem from './ShowMenuItem';
import RestaurantsList from './RestaurantsList';
import Cart from './Cart';
import Admin from './Admin';
import Admin2 from './Admin2'
import currency from 'currency.js';
import { printCartItemDetails, calcSubtotal, printSubtotal } from './Cart';

export const MenuContext = React.createContext();

export function roundedToFixed(input, digits) {
	var rounder = Math.pow(10, digits);
	var result = (Math.round(input * rounder) / rounder).toFixed(digits);
	return result;
}
export function App(props) {
	const [cart, setCart] = useState([]);
	const [cartAmount, setCartAmount] = useState(0);
	const [restaurant, setRestaurant] = useState(-1);
	const [restaurantName, setRestaurantName] = useState("");
	const [menuItem, setMenuItem] = useState(-1);

	function Checkout() {
		const [fee, setFee] = useState(0.00);
		const [subtotal, setSubtotal] = useState(0.00);
		useEffect(() => {
			let newSubtotal = calcSubtotal(cart, setSubtotal);
			setSubtotal(newSubtotal);
		}, [cart]);
		return (
			<div>
				<h1>Checkout</h1>
				<div className="row">
					<div className="col-sm-7">
					{
						cart.map(ci => {
							return (
								<>
									{printCartItemDetails(ci)}	
								</>
							)
						})
					}
					</div>
					<div className="col-sm-5">
						{printSubtotal(subtotal)}
						<h3 className="text-end">
							<u>
								Service Fee: <b>${roundedToFixed(fee, 2)}</b>
							</u>
						</h3>
						<h3 className="text-end">
							Total: <b>${currency(subtotal).add(currency(fee)).value}</b>
						</h3>
					</div>
				</div>
			</div>
		);
	}

	useEffect(() => {
		console.log("useEffect App")
		let ca = 0;
		for (const item in cart) {
			ca += cart[item].quantity;
		}
		setCartAmount(ca)
	}, [cart, setCart, setCartAmount]);
	function servicesForm() {
		return (
			<BrowserRouter>
				<div className="outter mx-auto">
					<div className="row">
						<div className="col-sm-6">
							<Link to="/">
								<button className="removebutton align-text-bottom">
									<span className="logofont2">RivCo</span>
									<span className="logofont">DELIVERY</span>
								</button>
							</Link>
						</div>
						<div className="col-sm-6 text-sm-end text-xs-end ">
							<Link to="/cart">
								<button className="btn btn-secondary btn-lg m-1">
									<i className="bi bi-cart"></i> Cart ({cartAmount})
								</button>
							</Link>
						</div>
					</div>
					<div className="mx-auto p-3 blackborder">
						<Routes>
							<Route
								path='*'
								exact={true}
								element={
									<RestaurantsList
										setRestaurantName={setRestaurantName}
										roundedToFixed={roundedToFixed}/>
								}
							/>
							<Route
								path={"/showMenu"}
								element={
									<ShowMenu
										restaurantName={restaurantName}
										restaurant={restaurant} />
								}
							/>
							<Route
								path={"/showMenuItem"}
								element={
									<ShowMenuItem
										cartAmount={cartAmount}
										setCartAmount={setCartAmount}
										restaurant={restaurant}
										restaurantName={restaurantName}
										menuItem={menuItem}
										cart={cart}
										setCart={setCart} />
								}
							/>
							<Route
								path={"/cart"}
								element={
									<Cart
										cartAmount={cartAmount}
										setCartAmount={setCartAmount}
										cart={cart}
										setCart={setCart} />
								} 
							/>
							<Route
								path={"/checkout"}
								element={
									<Checkout />
								} 
							/>
							<Route
								path={"/admin"}
								element={
									<Admin />
								}
							/>
							<Route
								path={"/admin2"}
								element={
									<Admin2 />
								}
							/>
						</Routes>
					</div>
					<Link to="/admin">
						Admin
					</Link>
					<span> </span>
					<Link to="/admin2">
						Admin2
					</Link>
				</div>
			</BrowserRouter>
		);
	}
	return (
		<div>
			<MenuContext.Provider value={
				[
					restaurant,
					setRestaurant,
					menuItem,
					setMenuItem
				]
			}>
				<br />
				<div>{servicesForm()}</div>

				<br />
			</MenuContext.Provider>
		</div>
	);
}
export default App;
